css:
.git-plus .error {
  color: #e2c08d;
}
.git-plus .success {
  color: #73c990;
}
.git-plus .atom-panel.modal.from-bottom {
  width: 600px;
}
.git-plus.info-view {
  overflow: auto;
  max-height: 30vh;
}
.select-list-buttons {
  margin-top: 5px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
atom-text-editor .diff .unimportant,
atom-text-editor::shadow .diff .unimportant {
  color: #494d57;
}
atom-text-editor .diff .info,
atom-text-editor::shadow .diff .info {
  color: #e0c285;
}
atom-text-editor .diff .deletion,
atom-text-editor::shadow .diff .deletion {
  color: #e05252;
}
atom-text-editor .diff .insertion,
atom-text-editor::shadow .diff .insertion {
  color: #43d08a;
}
atom-text-editor .diff .markup.removed.diff,
atom-text-editor::shadow .diff .markup.removed.diff,
atom-text-editor .diff .meta.diff.header.from-file,
atom-text-editor::shadow .diff .meta.diff.header.from-file {
  border-bottom: 2px solid #e05252;
}
atom-text-editor .diff .markup.added.diff,
atom-text-editor::shadow .diff .markup.added.diff,
atom-text-editor .diff .meta.diff.header.to-file,
atom-text-editor::shadow .diff .meta.diff.header.to-file {
  border-bottom: 2px solid #43d08a;
}
.git-plus-log {
  background-color: #282c34;
  overflow-y: auto;
}
.git-plus-log #git-plus-commits {
  color: #9da5b4;
  cursor: pointer;
}
.git-plus-log #git-plus-commits td {
  padding: 8px 10px;
  border-bottom: 1px solid #000;
  vertical-align: top;
}
.git-plus-log #git-plus-commits .author {
  width: 30%;
}
.git-plus-log #git-plus-commits .date {
  width: 25%;
}
.git-plus-log #git-plus-commits .message {
  width: 50%;
}
.git-plus-log #git-plus-commits .hashShort {
  width: 10%;
  text-align: right;
}
